import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { ContextLayoutComponent } from './shared/layouts/context-layout/context-layout.component';
import { BaseLayoutComponent } from './shared/layouts/base-layout/base-layout.component';
import { InternshipManagementModule } from './features/internship-management/internship-management.module';
import { InternshipListComponent } from './features/internship-management/internship-list/internship-list.component';
import { InternshipDetailComponent } from './features/internship-management/internship-detail/internship-detail.component';

const routes: Routes = 
[
  {
    path: 'auth',
    component: BaseLayoutComponent
  },

  {
    path: 'home',
    component: ContextLayoutComponent,
    children: [
      {
        path: 'x',
        component: InternshipListComponent
      },

      {
        path: 'a',
        component: InternshipDetailComponent
      }
    ]
  }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
